import React from 'react';
import './App.css';
import ProductList from './ProductList';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="navbar">
          <a href="#home">Home</a>
          <a href="#products">Products</a>
          <a href="#contact">Contact</a>
        </div>
        <h1>Welcome to Honey Business</h1>
      </header>
      <ProductList />
    </div>
  );
}

export default App;
